import React from 'react'
import TodoMain from './TodoMain/TodoMain'

export default function App() {
    function createBlock () {
        return (
            <ul class = "main__taskList">
                <li class = "taskItem">
                    <label class = "taskItem__label" for="itemCheck">
                        <input id = "itemCheck" type="checkbox"/>
                        <div class = "taskItem__textBox">
                            <p class = "taskItem__text"></p>
                        </div>
                        <p class = "taskItem__date">09/07/2021</p>
                    </label>
                    <button type ="button" class = "taskItem__btnCheck">
                        <img class = "taskItem__btnCheckIcon" src = "./src/image/trash.svg"/>
                    </button>
                </li>
            </ul>
        )
    }

    return (
        <TodoMain createBlock={createBlock}/>
    )
}
